import React from 'react';

export const TaskComplete=({task})=>{
    return(
    <>
        <input key={task.id} type="checkbox" checked={task.completion}/>
        <label style={{ marginLeft: '1rem', color: 'black' }}>{task.content}</label><br />
    </>
    )
}
